imageList.forEach((src) => {
  const itemImage = document.createElement("img");
  itemImage.src = src;
  itemImage.className = "roulette-img";
  itemImage.style.display = "none";
  rouletteElement.appendChild(itemImage);
});
const imageElements = document.getElementsByTagName("img");
const topImageIndex = imageElements.length - 1;
imageElements[topImageIndex].style.display = "";

// チェックボックス
const checkboxes = document.querySelectorAll("input[type=checkbox]");
let perfecture = [1, 24, 28, 44];
perfecture.forEach((index) => {
  checkboxes[index].checked = false;
});

checkboxes.forEach((element, i) => {
  element.addEventListener("change", () => {
    const index = perfecture.indexOf(i);
    if (index === -1) {
      perfecture.push(i);
    } else {
      perfecture.splice(index, 1);
    }
  });
});

// スタート・ストップボタン
let roulette;
let past = topImageIndex;
let next = 0;
let last = 0;
const start = () => {
  if (perfecture.length === 0) {
    last = topImageIndex - Math.floor(Math.random() * 5 + 1);
  } else {
    last = perfecture[Math.floor(Math.random() * perfecture.length)];
  }
  roulette = setInterval(() => {
    next = Math.floor(Math.random() * topImageIndex);
    imageElements[past].style.display = "none";
    imageElements[next].style.display = "";
    past = next;
  }, 100);
};
const stop = () => {
  if (roulette) {
    clearInterval(roulette);
    imageElements[next].style.display = "none";
    imageElements[last].style.display = "";
    past = last;
  }
};
const button = document.getElementById("switch");
const buttonSwitch = () => {
  if (button.value === "す た ー と") {
    button.value = "す と っ ぷ";
    start();
  } else if (button.value === "す と っ ぷ") {
    button.value = "す た ー と";
    stop();
  }
};
